import {Routes, Route} from 'react-router-dom'
import Home from './pages/home';
import './App.css';
import Register from './pages/register';
import Login from './pages/login';
import VerifyUser from './pages/verifyUser';
import Map from './pages/map';
import Map1 from './pages/map/map';
import Parking from './pages/parking';
import CssBaseline from '@mui/material/CssBaseline';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import IconButton from '@mui/material/IconButton';
import Brightness4Icon from '@mui/icons-material/Brightness4';
import Brightness7Icon from '@mui/icons-material/Brightness7';

function App() {
const darkTheme = createTheme({
  palette: {
    mode,
    ...(mode === 'light'
      ? {
          // palette values for light mode
          primary: amber,
          divider: amber[200],
          text: {
            primary: grey[900],
            secondary: grey[800],
          },
        }
      : {
          // palette values for dark mode
          primary: deepOrange,
          divider: deepOrange[700],
          background: {
            default: deepOrange[900],
            paper: deepOrange[900],
          },
          text: {
            primary: '#fff',
            secondary: grey[500],
          },
        }),
  },
});
const toggleColorMode = () =>{
  setMode('light');
}
const [mode, setMode] = React.useState('dark');
  return (
    <>
      <ThemeProvider theme={darkTheme}>
        <CssBaseline />
        <IconButton sx={{ ml: 1 }} onClick={toggleColorMode} color="inherit">
          {darkTheme.palette.mode === 'dark' ? <Brightness7Icon /> : <Brightness4Icon />}
        </IconButton>
        <Routes>
          <Route exact path="/" element={<Home />}></Route>
          <Route exact path="/register" element={<Register />}></Route>
          <Route exact path="/login" element={<Login />}></Route>
          <Route exact path="/verifyUser" element={<VerifyUser />}></Route>
          <Route exact path='/map' element={<Map/>}></Route>
          <Route exact path="/map1" element={<Map1 />}></Route>
          <Route exact path="/parking" element={<Parking />}></Route>
        </Routes>
      </ThemeProvider>
    </>
  );
}

export default App;
